          <img src="/Soil.png" alt="SOIL Organic Food Grocer" />
          <h1 className="title">SOIL Organic Food Grocer</h1>
          <p className="description">Explore our selection of premium organic foods and nutritional advice.</p>
        </div>
      </div>
    );
}

export default Home;
